import logo from './logo.svg';
import './App.css';
import ContactList from './ContactList';

function App() {
  const type = 'number';
  const minValue = 5;
  const maxValue = 12;

  return (
    <div className="App">
     <h1> Contacts</h1>
     <ContactList/>
     <input type = {type} min={minValue} max ={maxValue}/>
     <textarea autoFocus={true}/>
     <input placeholder="hi there" />
    </div>
  );
}

export default App;
